contracts/MessageStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

contract MessageStorage {
    // Struct to represent the structure of a message
    struct Message {
        address sender; // Ethereum address of the sender
        address recipient; // Ethereum address of the recipient
        string content; // Content of the message
        uint256 timestamp; // Timestamp when the message was sent
        bool isRead; // Flag to indicate if the message has been read
        bool isDeleted; // Flag to indicate if the message has been deleted
    }

    // Mapping to associate each user's Ethereum address with an array of messages
    mapping(address => Message[]) public userMessages;

    // Event to emit when a new message is sent
    event MessageSent(
        address indexed sender,
        address indexed recipient,
        string content
    );

    // Function to send a new message
    function sendMessage(address _recipient, string memory _content) public {
        Message memory newMessage = Message({
            sender: msg.sender,
            recipient: _recipient,
            content: _content,
            timestamp: block.timestamp,
            isRead: false,
            isDeleted: false
        });

        userMessages[msg.sender].push(newMessage);
        userMessages[_recipient].push(newMessage);

        emit MessageSent(msg.sender, _recipient, _content);
    }

    // Function to retrieve all messages for the caller
    function getMyMessages() public view returns (Message[] memory) {
        return userMessages[msg.sender];
    }

    // Function to update the status of a message to "read"
    function markAsRead(uint256 _messageIndex) public {
        require(
            _messageIndex < userMessages[msg.sender].length,
            "Invalid message index"
        );

        userMessages[msg.sender][_messageIndex].isRead = true;
    }

    function deleteMessage(uint256 _messageIndex) public {
        require(
            _messageIndex < userMessages[msg.sender].length,
            "Invalid message index"
        );

        // Mark the message as deleted
        userMessages[msg.sender][_messageIndex].isDeleted = true;
    }
}

contracts/UserRegistrationAndAuthenticat.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

error UserNotRegistered();

//0x3a2f83b7b29e34942a4a3211bcb3e8e146c4f779193fc4f3246c41fcf5c221b8
contract UserRegistrationAndAuthentication {
    // Struct to store user information
    struct User {
        string name; // User's name
        string email; // User's email address
        bytes32 passwordHash; // Hashed password
        bool isRegistered; // Flag to indicate if the user is registered
        address[] friendList; // Array to store friend addresses
    }

    // Mapping to link each user's Ethereum address with their user information
    mapping(address => User) public users;

    // Event to emit when a new user is registered
    event UserRegistered(
        address indexed userAddress,
        string name,
        string email
    );

    event FriendAdded(
        address indexed userAddress,
        address indexed friendAddress
    );

    // Function to register a new user
    function registerUser(
        string memory _name,
        string memory _email,
        bytes32 _passwordHash
    ) public {
        require(!users[msg.sender].isRegistered, "User already registered");
        // can add in more checks here like name/email/password cannot be empty
        User memory newUser = User({
            name: _name,
            email: _email,
            passwordHash: _passwordHash,
            isRegistered: true,
            friendList: new address[](0) // to initiate empty friend list
        });
        //push details of user into array
        users[msg.sender] = newUser;

        emit UserRegistered(msg.sender, _name, _email);
    }

    // Function to retrieve user information for the caller
    function getMyUserInfo()
        public
        view
        returns (string memory, string memory,address[]memory)
    {
        require(users[msg.sender].isRegistered, "User not registered");

        return (users[msg.sender].name, users[msg.sender].email, users[msg.sender].friendList);
    }

    // Function to authenticate user based on password hash
    function authenticate(bytes32 _passwordHash) public view returns (bool) {
        require(users[msg.sender].isRegistered, "User not registered");

        return users[msg.sender].passwordHash == _passwordHash;
    }

    function addFriend(address _friendAddress) public {
        // check that user is registered
        require(users[msg.sender].isRegistered, "User not registered!");
        require(
            msg.sender != _friendAddress,
            "User cannot add themselves as friend!"
        );
        if (!users[_friendAddress].isRegistered) revert UserNotRegistered();

        // check if friend already exist in list
        bool isFriend = false;
        for (uint256 i = 0; i < users[msg.sender].friendList.length; i++) {
            if(users[msg.sender].friendList[i]==_friendAddress){
                isFriend = true;
                break;
            }
        }
        require(!isFriend,"User is already a friend");
        users[msg.sender].friendList.push(_friendAddress);
        emit FriendAdded(msg.sender,_friendAddress);

        //bi-directional friend addition
        users[_friendAddress].friendList.push(msg.sender);
        emit FriendAdded(_friendAddress,msg.sender);
    }
    // GET MY FRIEND
    function getMyFriendList() public view returns(address[]memory){
        require(users[msg.sender].isRegistered,"User not registered");
        return users[msg.sender].friendList;
    }

}

